import React from 'react'
import './Review.css'
const Review = (props) => {
    const dt=props.Data;
  return (
    <div>
       
        <div className='pp3'>
            {dt.map((m)=>(
                <div className='div1' >
                    <h1 className='nam1'>{m.name}</h1>
                    <div className='div2'>
                    <h2 className='d1'>Rated : {m.rate}</h2>
                    <p className='d2'>{m.comment}</p>
                    </div>
                    </div>
            ))}

        </div>
      
    </div>
  )
}

export default Review
